// frontend/src/pages/admin/FinancialReports.jsx
import React, { useState, useEffect } from 'react';
import service from '../../services/service';
import './AdminPages.css';

const FinancialReports = () => {
  const [reports, setReports] = useState([]);
  const [loading, setLoading] = useState(false);
  const [dateRange, setDateRange] = useState({
    startDate: new Date(Date.now() - 30 * 24 * 60 * 60 * 1000).toISOString().split('T')[0],
    endDate: new Date().toISOString().split('T')[0]
  });
  const [reportType, setReportType] = useState('daily');
  const [selectedReport, setSelectedReport] = useState(null);

  const loadReports = async () => {
    try {
      setLoading(true);
      const response = await service.generateReport(
        reportType,
        dateRange.startDate,
        dateRange.endDate
      );
      if (response.success) {
        setReports(response.data);
      }
    } catch (error) {
      console.error('Error loading reports:', error);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    loadReports();
  }, [reportType, dateRange]);

  const formatCurrency = (amount) => {
    return amount.toLocaleString('ar-EG', {
      minimumFractionDigits: 2,
      maximumFractionDigits: 2
    }) + ' ÿ¨';
  };

  return (
    <div className="admin-page">
      <div className="page-header">
        <h1>üí∞ ÿßŸÑÿ™ŸÇÿßÿ±Ÿäÿ± ÿßŸÑŸÖÿßŸÑŸäÿ©</h1>
      </div>

      {/* ÿ£ÿØŸàÿßÿ™ ÿßŸÑÿ™ŸÇÿ±Ÿäÿ± */}
      <div className="reports-controls">
        <div className="report-type-selector">
          <button 
            className={reportType === 'daily' ? 'active' : ''}
            onClick={() => setReportType('daily')}
          >
            üìÖ ÿßŸÑÿ™ŸÇÿ±Ÿäÿ± ÿßŸÑŸäŸàŸÖŸä
          </button>
          <button 
            className={reportType === 'weekly' ? 'active' : ''}
            onClick={() => setReportType('weekly')}
          >
            üìä ÿßŸÑÿ™ŸÇÿ±Ÿäÿ± ÿßŸÑÿ£ÿ≥ÿ®ŸàÿπŸä
          </button>
          <button 
            className={reportType === 'monthly' ? 'active' : ''}
            onClick={() => setReportType('monthly')}
          >
            üìà ÿßŸÑÿ™ŸÇÿ±Ÿäÿ± ÿßŸÑÿ¥Ÿáÿ±Ÿä
          </button>
          <button 
            className={reportType === 'yearly' ? 'active' : ''}
            onClick={() => setReportType('yearly')}
          >
            üéØ ÿßŸÑÿ™ŸÇÿ±Ÿäÿ± ÿßŸÑÿ≥ŸÜŸàŸä
          </button>
        </div>

        <div className="date-range-selector">
          <div className="date-input-group">
            <label>ŸÖŸÜ</label>
            <input
              type="date"
              value={dateRange.startDate}
              onChange={(e) => setDateRange(prev => ({...prev, startDate: e.target.value}))}
            />
          </div>
          <div className="date-input-group">
            <label>ÿ•ŸÑŸâ</label>
            <input
              type="date"
              value={dateRange.endDate}
              onChange={(e) => setDateRange(prev => ({...prev, endDate: e.target.value}))}
            />
          </div>
          <button className="btn-primary" onClick={loadReports}>
            üîÑ ÿ™ÿ≠ÿØŸäÿ´
          </button>
        </div>
      </div>

      {/* ŸÖŸÑÿÆÿµ ÿßŸÑÿ™ŸÇÿ±Ÿäÿ± */}
      {loading ? (
